    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1621979805324,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1622145574602,"commentText":"<div>In the first playback you saw me create a database with a single table and you saw how I could use SQL to extract meaningful data from it. Most interesting databases have more than one entity where there are some relationships between the entities. <br></div><div><br></div><div>You probably noticed that the first table didn't store any information about the locations of the dogs. I will tackle this next by creating a new entity that represents the locations of all of Paw Prints adoption centers. </div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-1","displayCommentEvent":{"id":"ev-0","timestamp":1621979805324,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-2","timestamp":1622329412568,"commentText":"I'll start by updating my ER Diagram to show a Locations entity with some attributes for the name of the location, address, and the location's capacity to hold dogs. I'll add a primary key attribute called <font face=\"Courier\">id</font>. <br><br>There is a relationship between a dog and a location. Every dog is 'housed in' a location. I connect the Dogs and Locations entity with a line and a bit of text describing the relationship. The line connecting the two makes it crystal clear that these two entities are related to each other (see the first attached picture).<br><br><div>The relationship actually goes in two directions:</div><div><br></div><i>Any one dog is housed in exactly one location.<br>Any one location houses zero or many dogs.<br></i><br>At each end of the relationship you specify a how many instances of the entities participate in the relationship. This is also called the 'cardinality' of the relationship. There is a minimum cardinality and a maximum cardinality. The possible values are zero, one, or many. See the second attached picture. In the case of the locations, \"<i>any one location can house <b>zero or many</b> dogs.</i>\" <br><br>How come it is not a minimum cardinality of at least one dog in every location? Well, that requirement came from the customer. They let me know that when a new location opens up there are usually no dogs in it. So, for a short time I may have an entry in the Locations table without a corresponding dog related to it. Another pet adoption center may work differently. If so, that database might have a minimum cardinality of one. Make sure to always talk to your customers about their requirements. Don't assume you know how their systems should work!<br><br><div>Always think about your relationships in both directions. I usually think in terms like these:</div><div><br></div>Any one <font face=\"Courier\">ENTITY1</font> is <font face=\"Courier\">RELATIONSHIP_DESCRIPTION</font> by (<i>0, 1 or Many</i>) <font face=\"Courier\">ENTITY2</font>.<br>Any one <font face=\"Courier\">ENTITY2</font> is <font face=\"Courier\">RELATIONSHIP_DESCRIPTION</font> by (<i>0, 1 or Many</i>) <font face=\"Courier\">ENTITY1</font>.<br><br>There are three main types of relationships, one-to-one, one-to-many, and many-to-many. All of these are determined by the maximum cardinalities of the relationships. In my dogs and locations example because one side has a maximum cardinality of 'one' and the other side has a maximum cardinality of 'many' this relationship is a one-to-many relationship.","selectedCodeBlocks":[],"imageURLs":["media/images/1622135713874-01.jpeg","media/images/1622135713874-02.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-2","displayCommentEvent":{"id":"ev-0","timestamp":1621979805324,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-2","timestamp":1622328337761,"commentText":"<div>Next, I need to update my schema. The schema has the same data as the ER Diagram but it emphasizes different aspects of the design. There are no lines connecting the table headings together. Instead, the way you indicate a relationship in a schema (and in the database tables) is with a 'foreign key'. <br></div><div><br></div><div>A foreign key refers to the primary key of another entity. You can think of it like a pointer that says to, \"go look up this primary key to find the related entity.\" The first attached picture now has the schema.</div><br><div>With a one-to-many relationship, like I have with dogs and locations, the foreign key <i>always</i> goes on the side with the 'many' attached to it in the ER Diagram, in this case the dog. <br></div><div><br></div><div>The reason for this is because of the rule I mentioned earlier. Every attribute can have at most one value associated with it. A dog can hold its single location value but a location cannot hold a collection of dog ids. This would violate the first normal form I mentioned earlier.<br></div><div><br></div><div>The second attached picture shows what the tables will look like with some data in them. You can see that the column headings come from the schema. The rows hold info about dogs and locations. The Dogs table's foreign key value refers to the location that a dog is housed in. The location data is no longer stored redundantly. This means that if I change the name of the location all of the dogs that refer to it through a foreign key will have access to the new name. There is no possibility for inconsistency.<br></div><br>Look at the ER Diagram and the schema now. The primary difference between them is how the relationships are presented. If I am curious about the relationships between two or more entities I am going to go straight to the ER Diagram because it is so clear how they all relate. If I am writing a query that involves a foreign key I am going to go straight to the schema because that is what is being stored in the database. Both are valuable models of the database and I usually create both every time I design a database.","selectedCodeBlocks":[],"imageURLs":["media/images/1622139869618-03.jpeg","media/images/1622140309730-04.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-208":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-208","timestamp":1621979872703,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":208,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-207","lineNumber":10,"column":2,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622328401727,"commentText":"Now, I'll create the Locations table and fill it with some data. I have broken the address up into several different attributes and marked the <font face=\"Courier\">id</font> attribute as the primary key. Because <font face=\"Courier\">id</font> is an <font face=\"Courier\">INTEGER</font> and marked as the primary key SQLite will generate these values for me.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"CREATE TABLE Locations","startRow":0,"startColumn":0,"endRow":0,"endColumn":22},{"fileId":"fileId-0","selectedText":"PRIMARY KEY(id)","startRow":8,"startColumn":4,"endRow":8,"endColumn":19}],"imageURLs":["media/images/1621980975440-Screen Shot 2021-05-25 at 5.15.38 PM.png","media/images/1621980975440-Screen Shot 2021-05-25 at 5.15.54 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/createLocationsTable.sql","viewableBlogText":"CREATE TABLE Locations (\n    id          INTEGER,\n    name        TEXT,\n    addressLine TEXT,\n    city        TEXT,\n    state       TEXT,\n    zip         TEXT,\n    capacity    INTEGER,\n    PRIMARY KEY(id)\n);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-484":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-484","timestamp":1621979904530,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":484,"type":"INSERT","fileId":"fileId-1","character":";","previousNeighborId":"ev-483","lineNumber":5,"column":63,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622328432400,"commentText":"<div>Next, I'll insert some data into the new table. I am adding three locations. Each one will get an auto-generated primary key value. The second picture shows the 'Browse Data' view of the data in the table after the insert.<br></div><div><br></div><div>These primary key values (1, 2, 3) will eventually be stored as foreign keys in the Dogs table linking dogs to locations.</div>","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"INSERT INTO Locations","startRow":0,"startColumn":0,"endRow":0,"endColumn":21}],"imageURLs":["media/images/1621981039291-Screen Shot 2021-05-25 at 5.16.47 PM.png","media/images/1621981039291-Screen Shot 2021-05-25 at 5.17.05 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"4","currentFilePath":"/insertLocations.sql","viewableBlogText":"INSERT INTO Locations (name, addressLine, city, state, zip, capacity) \nVALUES \n(\"Kenosha South\", \"123 1st St.\", \"Kenosha\", \"WI\", \"53140\", 12),\n(\"Kenosha West\", \"234 75th St.\", \"Paddock Lake\", \"WI\", \"53168\", 10),\n(\"Racine\", \"345 Washington Ave.\", \"Racine\", \"WI\", \"53403\", 20);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-558":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-558","timestamp":1621979931021,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":558,"type":"INSERT","fileId":"fileId-2","character":";","previousNeighborId":"ev-557","lineNumber":2,"column":56,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622140793819,"commentText":"Before I can move on, though, I need to update the Dogs table to include the new foreign key. In SQL there is an <a href=\"https://www.sqlite.org/lang_altertable.html\"><font face=\"Courier\">ALTER TABLE</font> statement</a> to change a table after the <font face=\"Courier\">CREATE TABLE</font> statement has already been executed.<br><br>","selectedCodeBlocks":[{"fileId":"fileId-2","selectedText":"ALTER TABLE Dogs\nADD COLUMN locationId INTEGER REFERENCES Locations (id);","startRow":0,"startColumn":0,"endRow":1,"endColumn":56}],"imageURLs":["media/images/1621981119071-Screen Shot 2021-05-25 at 5.18.06 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/alterDogs.sql","viewableBlogText":"ALTER TABLE Dogs\nADD COLUMN locationId INTEGER REFERENCES Locations (id);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-22","displayCommentEvent":{"id":"ev-558","timestamp":1621979931021,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":558,"type":"INSERT","fileId":"fileId-2","character":";","previousNeighborId":"ev-557","lineNumber":2,"column":56,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622328477188,"commentText":"<div>When defining an attribute in a table you can mark it as a foreign key by adding the <font face=\"Courier\">REFERENCES</font> keyword after its type. This says that the attribute, <font face=\"Courier\">locationId</font>, now refers to the Locations table's <font face=\"Courier\">id</font> attribute. In other words, a row in the Dogs table may refer to a row in the Locations table through <font face=\"Courier\">locationId</font>. This defines the relationship between the Dogs table and the Locations table.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-2","selectedText":"REFERENCES Locations (id)","startRow":1,"startColumn":30,"endRow":1,"endColumn":55}],"imageURLs":["media/images/1622140309730-04.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/alterDogs.sql","viewableBlogText":"ALTER TABLE Dogs\nADD COLUMN locationId INTEGER REFERENCES Locations (id);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-6","displayCommentEvent":{"id":"ev-558","timestamp":1621979931021,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":558,"type":"INSERT","fileId":"fileId-2","character":";","previousNeighborId":"ev-557","lineNumber":2,"column":56,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622328527854,"commentText":"All foreign keys must either refer to an existing primary key value somewhere in the database or have the value <font face=\"Courier\">NULL</font>. This is called <b>referential integrity</b> and it is an important part of maintaining a consistent database.<br><br><div>How will this affect the existing dogs in the database? Each dog's <font face=\"Courier\">locationId</font> is supposed to refer to the primary key of the location that they are housed in. But since the locations were just added each dog's <font face=\"Courier\">locationId</font> attribute which will will be set to <font face=\"Courier\">NULL</font>. <font face=\"Courier\">NULL</font> means the absence of a value. So, no dogs will have a location until I update them. <br></div><div><br></div><div>The two attached screenshots show the Dogs table before and after I execute this SQL. In the second one every dog has a <font face=\"Courier\">NULL</font> <font face=\"Courier\">locationId</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-2","selectedText":"ALTER TABLE Dogs\nADD COLUMN locationId INTEGER REFERENCES Locations (id);","startRow":0,"startColumn":0,"endRow":1,"endColumn":56}],"imageURLs":["media/images/1621981119071-Screen Shot 2021-05-25 at 5.17.47 PM.png","media/images/1621981119071-Screen Shot 2021-05-25 at 5.18.16 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/alterDogs.sql","viewableBlogText":"ALTER TABLE Dogs\nADD COLUMN locationId INTEGER REFERENCES Locations (id);","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1332":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-1332","timestamp":1621979953581,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1332,"type":"INSERT","fileId":"fileId-3","character":";","previousNeighborId":"ev-1331","lineNumber":17,"column":45,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622324231420,"commentText":"<div>Here I update the 17 existing dogs to have a <font face=\"Courier\">locationId</font>. I am using the <a href=\"https://www.sqlite.org/lang_update.html\"><font face=\"Courier\">UPDATE</font> statement</a> to specify certain rows that should be updated. <font face=\"Courier\">UPDATE</font>'s have an optional <font face=\"Courier\">WHERE</font> clause so you can say which rows should be updated.&nbsp; <br></div><div><br></div><div>I am manually assigning the dogs to locations by referring to each dog's <font face=\"Courier\">id</font>. The second attached screenshot shows the new state of the Dogs table.<br></div><div><br></div><div>If I left the <font face=\"Courier\">WHERE</font> clause out and said something like:</div><div><br></div><div><font face=\"Courier\">UPDATE Dogs SET locationId = 1;</font></div><div><br></div><div>then <i>all</i> the dogs in the table would have their <font face=\"Courier\">locationId</font> set to 1.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"UPDATE Dogs SET locationId = 1 WHERE id = 1;","startRow":0,"startColumn":0,"endRow":0,"endColumn":44}],"imageURLs":["media/images/1621981218119-Screen Shot 2021-05-25 at 5.19.57 PM.png","media/images/1621981218119-Screen Shot 2021-05-25 at 5.20.03 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"16","currentFilePath":"/updateDogs.sql","viewableBlogText":"UPDATE Dogs SET locationId = 1 WHERE id = 1;\nUPDATE Dogs SET locationId = 2 WHERE id = 2;\nUPDATE Dogs SET locationId = 2 WHERE id = 3;\nUPDATE Dogs SET locationId = 1 WHERE id = 4;\nUPDATE Dogs SET locationId = 1 WHERE id = 5;\nUPDATE Dogs SET locationId = 3 WHERE id = 6;\nUPDATE Dogs SET locationId = 1 WHERE id = 7;\nUPDATE Dogs SET locationId = 3 WHERE id = 8;\nUPDATE Dogs SET locationId = 3 WHERE id = 9;\nUPDATE Dogs SET locationId = 2 WHERE id = 10;\nUPDATE Dogs SET locationId = 2 WHERE id = 11;\nUPDATE Dogs SET locationId = 1 WHERE id = 12;\nUPDATE Dogs SET locationId = 3 WHERE id = 13;\nUPDATE Dogs SET locationId = 3 WHERE id = 14;\nUPDATE Dogs SET locationId = 1 WHERE id = 15;\nUPDATE Dogs SET locationId = 2 WHERE id = 16;\nUPDATE Dogs SET locationId = 1 WHERE id = 17;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-23","displayCommentEvent":{"id":"ev-1332","timestamp":1621979953581,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1332,"type":"INSERT","fileId":"fileId-3","character":";","previousNeighborId":"ev-1331","lineNumber":17,"column":45,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622146535295,"commentText":"<div>As I stated before, relational databases have a concept known as 'referential integrity'. What this means is that if there is a foreign key attribute in a table, like in the Dogs table, then it must hold the value of an existing primary key. <br></div><div><br></div><div>I can't store the value 100 for any dog's <font face=\"Courier\">locationId</font> because there is not currently an <font face=\"Courier\">id</font> of 100 in the Locations table. The DBMS will prevent users from violating referential integrity. In the highlighted code I am only using valid Location <font face=\"Courier\">id</font>s (1, 2, 3). <br></div><div><br></div><div>A foreign key may also be null meaning that there is no relationship set. In this case that would mean we have a dog in the database but haven't assigned it to a location yet.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":0,"startColumn":16,"endRow":0,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 2","startRow":1,"startColumn":16,"endRow":1,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 2","startRow":2,"startColumn":16,"endRow":2,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":3,"startColumn":16,"endRow":3,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":4,"startColumn":16,"endRow":4,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 3","startRow":5,"startColumn":16,"endRow":5,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":6,"startColumn":16,"endRow":6,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 3","startRow":7,"startColumn":16,"endRow":7,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 3","startRow":8,"startColumn":16,"endRow":8,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 2","startRow":9,"startColumn":16,"endRow":9,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 2","startRow":10,"startColumn":16,"endRow":10,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":11,"startColumn":16,"endRow":11,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 3","startRow":12,"startColumn":16,"endRow":12,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 3","startRow":13,"startColumn":16,"endRow":13,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":14,"startColumn":16,"endRow":14,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 2","startRow":15,"startColumn":16,"endRow":15,"endColumn":30},{"fileId":"fileId-3","selectedText":"locationId = 1","startRow":16,"startColumn":16,"endRow":16,"endColumn":30}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/updateDogs.sql","viewableBlogText":"UPDATE Dogs SET locationId = 1 WHERE id = 1;\nUPDATE Dogs SET locationId = 2 WHERE id = 2;\nUPDATE Dogs SET locationId = 2 WHERE id = 3;\nUPDATE Dogs SET locationId = 1 WHERE id = 4;\nUPDATE Dogs SET locationId = 1 WHERE id = 5;\nUPDATE Dogs SET locationId = 3 WHERE id = 6;\nUPDATE Dogs SET locationId = 1 WHERE id = 7;\nUPDATE Dogs SET locationId = 3 WHERE id = 8;\nUPDATE Dogs SET locationId = 3 WHERE id = 9;\nUPDATE Dogs SET locationId = 2 WHERE id = 10;\nUPDATE Dogs SET locationId = 2 WHERE id = 11;\nUPDATE Dogs SET locationId = 1 WHERE id = 12;\nUPDATE Dogs SET locationId = 3 WHERE id = 13;\nUPDATE Dogs SET locationId = 3 WHERE id = 14;\nUPDATE Dogs SET locationId = 1 WHERE id = 15;\nUPDATE Dogs SET locationId = 2 WHERE id = 16;\nUPDATE Dogs SET locationId = 1 WHERE id = 17;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1363":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-1363","timestamp":1621981354094,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1363,"type":"INSERT","fileId":"fileId-4","character":";","previousNeighborId":"ev-1362","lineNumber":2,"column":21,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622328715319,"commentText":"<div>Ok, now for some more fun stuff. I'll be writing some queries involving both tables. I'll start by adding both tables to the <font face=\"Courier\">FROM</font> clause and displaying all of the attributes.</div><div><br></div><div>The first attached screenshot shows the results. DB Browser tells me there are 51 resulting rows. This is because in SQL when you specify more than one table in a <font face=\"Courier\">FROM</font> it creates a Cartesian product, or every combination of rows from all the tables. The second attached picture shows what I mean about combining rows in a Cartesian product.<br></div><div><br></div><div>In the query results the first three rows all have the dog info for Patches but three different sets of location info. The same is true for the next three rows for Amigo, and so on. There are 17 dogs and 3 locations so there are (17 * 3 = 51) resulting rows.</div><div><br></div><div>However, each dog is housed in a single location. The third screenshot highlights the rows where a dog's <font face=\"Courier\">locationId</font>&nbsp; (foreign key) is the same as the Location table's <font face=\"Courier\">id</font> (primary key). These are the rows that we want the DBMS to return because they represent the relationship between the dog and its location. Next, I'll use a <font face=\"Courier\">WHERE</font> clause to limit the results to those rows.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-4","selectedText":"SELECT *\nFROM Dogs, Locations;","startRow":0,"startColumn":0,"endRow":1,"endColumn":21}],"imageURLs":["media/images/1621981387519-Screen Shot 2021-05-25 at 5.21.58 PM.png","media/images/1622324317973-08.jpeg","media/images/1621981478606-Screen Shot 2021-05-25 at 5.23.24 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/query3.sql","viewableBlogText":"SELECT *\nFROM Dogs, Locations;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1400":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-1400","timestamp":1621981542117,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1400,"type":"INSERT","fileId":"fileId-4","character":"d","previousNeighborId":"ev-1399","lineNumber":3,"column":36,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622147179522,"commentText":"<div>In this updated query I am saying that I want the DBMS to perform a Cartesian product of all the rows in both tables but to only return the ones where the foreign key of the Dogs table (<font face=\"Courier\">locationId</font>) matches the primary key of the Locations table (<font face=\"Courier\">id</font>).</div><div><br></div><div>You can see that this is the case in the attached screenshot. There are now 17 rows returned (one for each dog) and the results now include information about the location that each dog is housed in. I have 'joined' these two tables together to produce more meaningful information than before.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-4","selectedText":"WHERE Dogs.locationId = Locations.id","startRow":2,"startColumn":0,"endRow":2,"endColumn":36}],"imageURLs":["media/images/1621981558888-Screen Shot 2021-05-25 at 5.25.22 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/query3.sql","viewableBlogText":"SELECT *\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1460":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-1460","timestamp":1621981643629,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1460,"type":"INSERT","fileId":"fileId-4","character":"e","previousNeighborId":"ev-1459","lineNumber":4,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622143218099,"commentText":"<div>Here I update the query to limit the attributes to display. I am projecting out the dog's name and age and the name of the location where each one is housed. Because each table has an attribute called <font face=\"Courier\">name</font> I have to be specific about where the attributes come from. You can precede the name of an attribute with the name of the table it belongs to.</div><div><br></div><div>I am also sorting by the location name (see the attached screenshot).<br></div>","selectedCodeBlocks":[{"fileId":"fileId-4","selectedText":"Dogs.name","startRow":0,"startColumn":7,"endRow":0,"endColumn":16},{"fileId":"fileId-4","selectedText":"Locations.name","startRow":0,"startColumn":28,"endRow":0,"endColumn":42}],"imageURLs":["media/images/1621981660303-Screen Shot 2021-05-25 at 5.27.04 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/query3.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nORDER BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1641":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-1641","timestamp":1621981760921,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1641,"type":"INSERT","fileId":"fileId-5","character":";","previousNeighborId":"ev-1640","lineNumber":5,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622147502265,"commentText":"Next, I will display all of the dogs that arrived after a certain date. Most of the query will remain the same as in the last step but now I will add another condition to the <font face=\"Courier\">WHERE</font> clause. I want only the dogs that arrived after a certain date. There are 8 dogs that arrived on or after August 1st, 2021.<br>","selectedCodeBlocks":[{"fileId":"fileId-5","selectedText":"AND Dogs.arrivalDate >= \"2021-08-01\"","startRow":3,"startColumn":0,"endRow":3,"endColumn":36}],"imageURLs":["media/images/1621981788114-Screen Shot 2021-05-25 at 5.28.50 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"1","currentFilePath":"/query4.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name, Dogs.arrivalDate\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.arrivalDate >= \"2021-08-01\"\nORDER BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1643":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-1643","timestamp":1621981794681,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1643,"type":"INSERT","fileId":"fileId-5","character":"9","previousNeighborId":"ev-1611","lineNumber":4,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1622143422898,"commentText":"Next, I change the date to September 1st and I only get one result back.<br>","selectedCodeBlocks":[{"fileId":"fileId-5","selectedText":"\"2021-09-01\"","startRow":3,"startColumn":24,"endRow":3,"endColumn":36}],"imageURLs":["media/images/1621981818699-Screen Shot 2021-05-25 at 5.29.02 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"1","currentFilePath":"/query4.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name, Dogs.arrivalDate\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.arrivalDate >= \"2021-09-01\"\nORDER BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1861":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-1861","timestamp":1621982218587,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1861,"type":"INSERT","fileId":"fileId-6","character":";","previousNeighborId":"ev-1860","lineNumber":6,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622147375052,"commentText":"In this query I am specifying a start and end date to find all of the dogs that arrived in between. I am using the <font face=\"Courier\">&gt;=</font> and <font face=\"Courier\">&lt;</font> to specify a range of acceptable dates. These operators work for all <font face=\"Courier\">TEXT</font> data to compare according to the contents of the string from left to right.<br>","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"AND Dogs.arrivalDate >= \"2021-08-01\"\nAND Dogs.arrivalDate < \"2021-09-01\"","startRow":3,"startColumn":0,"endRow":4,"endColumn":35}],"imageURLs":["media/images/1621982253916-Screen Shot 2021-05-25 at 5.31.39 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"2","currentFilePath":"/query5.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name, Dogs.arrivalDate\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.arrivalDate >= \"2021-08-01\"\nAND Dogs.arrivalDate < \"2021-09-01\"\nORDER BY Locations.name;\n","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-1867":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-1867","timestamp":1621982278828,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1867,"type":"INSERT","fileId":"fileId-6","character":"2","previousNeighborId":"ev-1828","lineNumber":5,"column":28,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1622150143403,"commentText":"<div>I can change the date strings to find all of the dogs arriving in the year 2021.</div><div><br></div><div>You might have noticed that <font face=\"Courier\">arrivalDate</font> is just a <font face=\"Courier\">TEXT</font> attribute, however, I am using a specific date format to ensure that I can compare dates:</div><div><br></div><div><font face=\"Courier\">YYYY-MM-DD</font></div><div><br></div><div>Because of the way string comparison works the years (at the beginning of the strings) will be compared first. If two strings have the same year value in <font face=\"Courier\">YYYY</font> then the months portion will be checked next. If the months are the same then the days will be compared.</div><div><br></div><div> Some DBMS's have special types for dates and times. SQLite chooses to use the <font face=\"Courier\">TEXT</font> type for date and time strings instead. Luckily, there are some built-in SQLite date and time functions <a href=\"https://sqlite.org/lang_datefunc.html\">here</a> and <a href=\"https://www.sqlitetutorial.net/sqlite-date-functions/sqlite-date-function/\">here</a> that can be used in any query.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"\"2021-01-01\"","startRow":3,"startColumn":24,"endRow":3,"endColumn":36},{"fileId":"fileId-6","selectedText":"\"2022-01-01\"","startRow":4,"startColumn":23,"endRow":4,"endColumn":35}],"imageURLs":["media/images/1621982298316-Screen Shot 2021-05-25 at 5.32.24 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"2","currentFilePath":"/query5.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name, Dogs.arrivalDate\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.arrivalDate >= \"2021-01-01\"\nAND Dogs.arrivalDate < \"2022-01-01\"\nORDER BY Locations.name;\n","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2011":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-2011","timestamp":1621982506176,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2011,"type":"INSERT","fileId":"fileId-7","character":";","previousNeighborId":"ev-2010","lineNumber":5,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622144143958,"commentText":"<div>In this query I will search for the younger dogs in the database. I am still joining the Dogs and Locations tables on the foreign key to primary key and I am sorting by the name of the location. <br></div><div><br></div><div>I am sorting by location name so that I can see groups of dogs by their location. In the attached screenshot you can see that it would be pretty easy for anyone reading these results to see the breakup by location.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"AND Dogs.age < 5","startRow":3,"startColumn":0,"endRow":3,"endColumn":16}],"imageURLs":["media/images/1621982530081-Screen Shot 2021-05-25 at 5.41.25 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"1","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.age < 5\nORDER BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2041":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-2041","timestamp":1621982570877,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2041,"type":"INSERT","fileId":"fileId-7","character":"\"","previousNeighborId":"ev-2040","lineNumber":5,"column":29,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622144298532,"commentText":"If I wanted to limit the results even further I could add another search criterion and chain it with the others with another <font face=\"Courier\">AND</font>. The attached screenshot shows all of the younger dogs in the Racine location.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"AND Locations.name = \"Racine\"","startRow":4,"startColumn":0,"endRow":4,"endColumn":29}],"imageURLs":["media/images/1621982588789-Screen Shot 2021-05-25 at 5.42.41 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"1","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Dogs.name, Dogs.age, Locations.name\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.age < 5\nAND Locations.name = \"Racine\"\nORDER BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2168":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-2168","timestamp":1621982672583,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2168,"type":"INSERT","fileId":"fileId-7","character":"P","previousNeighborId":"ev-2167","lineNumber":4,"column":5,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1622329217744,"commentText":"<div>Earlier I used <font face=\"Courier\">ORDER BY</font> to group all of the dogs in the results into locations. SQL allows you to do this grouping and then ask questions about the group instead of individual dogs.</div><div><br></div><div>The <font face=\"Courier\">GROUP BY</font> clause says to collect all of the dogs in the three different locations into groups. Then I can project out characteristics of the groups. <br></div><div><br></div><div>Here I am asking for a count of how many rows are in each group with <font face=\"Courier\">COUNT(*)</font>. I am using the <font face=\"Courier\">AS</font> keyword to give a new name to this column in the results. <br></div><div><br></div><div>For a reminder the first screenshot shows the query using <font face=\"Courier\">ORDER BY</font>. The second screenshot shows the query using <font face=\"Courier\">GROUP BY</font> and that there is one row returned for each group.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"Locations.name, COUNT(*) AS numDogs","startRow":0,"startColumn":7,"endRow":0,"endColumn":42},{"fileId":"fileId-7","selectedText":"GROUP BY Locations.name","startRow":3,"startColumn":0,"endRow":3,"endColumn":23}],"imageURLs":["media/images/1621981660303-Screen Shot 2021-05-25 at 5.27.04 PM.png","media/images/1621982699127-Screen Shot 2021-05-25 at 5.43.59 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, COUNT(*) AS numDogs\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;\n","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-24","displayCommentEvent":{"id":"ev-2168","timestamp":1621982672583,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2168,"type":"INSERT","fileId":"fileId-7","character":"P","previousNeighborId":"ev-2167","lineNumber":4,"column":5,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1622147925561,"commentText":"<div>When using <font face=\"Courier\">GROUP BY</font> you are asking the DBMS to form groups of rows around the values of one or more attributes. The only thing that is guaranteed to be the same about these rows are the attributes you are grouping by. So, you can only project out those attributes and use the aggregate operators like <font face=\"Courier\">COUNT</font>.</div><div><br></div><div>I cannot project out the dogs' breeds, for example, because in each group they might all be different. The breed has nothing to do with a dog's location. The one attribute value that is the same in each group is the location <font face=\"Courier\">name</font>. So that is the only attribute I can put in the <font face=\"Courier\">SELECT</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"Locations.name","startRow":0,"startColumn":7,"endRow":0,"endColumn":21},{"fileId":"fileId-7","selectedText":"Locations.name","startRow":3,"startColumn":9,"endRow":3,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, COUNT(*) AS numDogs\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2185":[{"id":"commentId-15","displayCommentEvent":{"id":"ev-2185","timestamp":1621982778476,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2185,"type":"INSERT","fileId":"fileId-7","character":"5","previousNeighborId":"ev-2184","lineNumber":4,"column":16,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622144887898,"commentText":"Here I am asking for the same groupings but I only want younger dogs. Now I can see where the younger dogs are housed.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"AND Dogs.age < 5","startRow":3,"startColumn":0,"endRow":3,"endColumn":16}],"imageURLs":["media/images/1621982796564-Screen Shot 2021-05-25 at 5.45.53 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"1","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, COUNT(*) AS numDogs\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND Dogs.age < 5\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2249":[{"id":"commentId-16","displayCommentEvent":{"id":"ev-2249","timestamp":1621982870405,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2249,"type":"DELETE","fileId":"fileId-7","character":"NEWLINE","previousNeighborId":"ev-1970","lineNumber":4,"column":1},"developerGroupId":"devGroupId-2","timestamp":1622150410517,"commentText":"<div><font face=\"Courier\">COUNT</font> is an aggregate operation. It counts how many rows are in a group. There are some other aggregate operations like <font face=\"Courier\">MIN</font>. <font face=\"Courier\"><br></font></div><div><font face=\"Courier\"><br></font></div><div><font face=\"Courier\">MIN</font> will find the minimum value of an attribute in each group. The DBMS will search each group by location for the minimum value of the Dog table's <font face=\"Courier\">age</font>. You put the name of the attribute you want in the parentheses. I can use it to find the youngest dog at each location.</div>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"MIN(Dogs.age) AS youngestDog","startRow":0,"startColumn":23,"endRow":0,"endColumn":51}],"imageURLs":["media/images/1621982888523-Screen Shot 2021-05-25 at 5.47.17 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, MIN(Dogs.age) AS youngestDog\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2303":[{"id":"commentId-17","displayCommentEvent":{"id":"ev-2303","timestamp":1621982927776,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2303,"type":"INSERT","fileId":"fileId-7","character":"g","previousNeighborId":"ev-2302","lineNumber":1,"column":49,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622148075126,"commentText":"<font face=\"Courier\">MAX</font> is similar but it finds the maximum value for an attribute in a group. This query tells me how old the oldest dog is in each location.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"MAX(Dogs.age) AS oldestDog","startRow":0,"startColumn":23,"endRow":0,"endColumn":49}],"imageURLs":["media/images/1621982949041-Screen Shot 2021-05-25 at 5.48.36 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, MAX(Dogs.age) AS oldestDog\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2359":[{"id":"commentId-18","displayCommentEvent":{"id":"ev-2359","timestamp":1621982986777,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2359,"type":"INSERT","fileId":"fileId-7","character":"e","previousNeighborId":"ev-2358","lineNumber":1,"column":53,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622148091218,"commentText":"<font face=\"Courier\">AVG</font> finds the average attribute value for a group.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"AVG(Dogs.age) AS averageDogAge","startRow":0,"startColumn":23,"endRow":0,"endColumn":53}],"imageURLs":["media/images/1621983005443-Screen Shot 2021-05-25 at 5.49.36 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, AVG(Dogs.age) AS averageDogAge\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2418":[{"id":"commentId-19","displayCommentEvent":{"id":"ev-2418","timestamp":1621983048865,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2418,"type":"INSERT","fileId":"fileId-7","character":"s","previousNeighborId":"ev-2417","lineNumber":1,"column":52,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622148109310,"commentText":"<font face=\"Courier\">SUM</font> will sum the attribute values in a group.<br>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"SUM(Dogs.age) AS sumOfDogAges","startRow":0,"startColumn":23,"endRow":0,"endColumn":52}],"imageURLs":["media/images/1621983067401-Screen Shot 2021-05-25 at 5.50.31 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.name, SUM(Dogs.age) AS sumOfDogAges\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.name;","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-2526":[{"id":"commentId-20","displayCommentEvent":{"id":"ev-2526","timestamp":1621983138942,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2526,"type":"INSERT","fileId":"fileId-7","character":" ","previousNeighborId":"ev-2525","lineNumber":4,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622148212005,"commentText":"<div>Technically, the location <font face=\"Courier\">name</font> is not the primary key of the Locations table and it is not guaranteed to be unique. The location <font face=\"Courier\">id</font> is, however, so it makes more sense to <font face=\"Courier\">GROUP BY</font> it instead. <br></div><div><br></div><div>The problem is that I want to project out the name of the location in the results but I can only project out what is common among all the rows in each group, in other words, what I am grouping by. To get around this I will include both the location's <font face=\"Courier\">id</font> and <font face=\"Courier\">name</font> in the <font face=\"Courier\">GROUP BY</font> so that both are available to use in the <font face=\"Courier\">SELECT</font>.</div><div><br></div><div>Now if there are two locations with the same <font face=\"Courier\">name</font> but different <font face=\"Courier\">ids</font> there will be a group associated with each of them which is what I would want.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"Locations.id, Locations.name","startRow":3,"startColumn":9,"endRow":3,"endColumn":37}],"imageURLs":["media/images/1621983165807-Screen Shot 2021-05-25 at 5.52.00 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"1","currentFilePath":"/query6.sql","viewableBlogText":"SELECT Locations.id, Locations.name, COUNT(*) AS numDogs\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nGROUP BY Locations.id, Locations.name;\n","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-21","displayCommentEvent":{"id":"ev-2526","timestamp":1621983138942,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2526,"type":"INSERT","fileId":"fileId-7","character":" ","previousNeighborId":"ev-2525","lineNumber":4,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1622329392427,"commentText":"<i><b>Summary</b></i><br><div>In this playback you saw that there can be more than one entity in a database and that there can be relationships between them. I showed how to model a one-to-many relationship.</div><div><br></div><div>Foreign keys link a row from one table to a row in another table. Foreign keys always go on the side that has the 'crows feet' (many) attached to them in the ER Diagram. <br></div><div><br></div><div>The whole point of doing this is to eliminate redundant data by splitting it into different tables. If there is no redundancy then there is no chance of inconsistency. <br></div><div><br></div><div>Referential integrity refers to the fact that foreign keys must hold actual primary key values (or be null). The DBMS will not allow invalid foreign keys to be stored anywhere in the database. This includes checking all inserts to make sure the foreign key values are good and checking all deletes to make sure a primary key that is referred to in another table's foreign key is not allowed to be deleted.</div><div><br></div><div>SQL's <font face=\"Courier\">FROM</font> clause allows multiple tables to participate in a query. The Cartesian product is every possible combination of rows from all of the tables. Almost always you will limit the results by 'joining' tables from foreign key to primary key.</div><div><br></div><div><font face=\"Courier\">GROUP BY</font> allows groups or rows to be treated as a single entity. You can use the aggregate operations <font face=\"Courier\">COUNT</font>, <font face=\"Courier\">MIN</font>, <font face=\"Courier\">MAX</font>, <font face=\"Courier\">AVG</font>, and <font face=\"Courier\">SUM</font> with a <font face=\"Courier\">GROUP BY</font>.<br></div><div><br></div><div>Finally, ER Diagrams and schemas show the same information but the former highlights the relationships between the entities where it is a little harder to see those connections in the schema.</div><div><br></div><div>Challenge: re-create this database and write these queries:</div><div>- What are the names and ages of all the schnauzers in the state of Wisconsin (WI)?</div><div>- What city is the dog named Puddy currently in?</div><div>- What is the sum total capacity of all the locations in the state of Wisconsin (WI)?</div>- What is the average age of the dogs in the Racine location?<br><div>- How many dogs are in the zip code 53140?</div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"/query6.sql","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
